<script setup>
import { ref, onMounted, reactive, computed } from "vue";
import FsyLogo from "../assets/logo.png";
import axios from "axios";
import { useRouter, useRoute } from "vue-router";
import { decode } from "../utils/base64";
//截图库
import { snapdom, preCache } from "@zumer/snapdom";
import useClipboard from "vue-clipboard3";
// 二维码库
import QRCode from "qrcode";
const API_BASE_URL = ref(window.ENV_CONFIG && window.ENV_CONFIG.VITE_API_URL);
const { toClipboard } = useClipboard();
const router = useRouter();
const route = useRoute();
// 截图预加载
const captureTarget = ref(null);
// 复制口令事件

const shMsg = ref("");
const onCopyText = async (text, tip) => {
  try {
    await toClipboard(text);
    showNotify({ type: "success", message: tip });
  } catch (error) {
    showNotify({ type: "danger", message: "当前浏览器不支持复制功能！" });
    return;
  }
};

const shareMsg = () => {
  shMsg.value = `【${msgData.list.cate_name}活动线报】\n${msgData.list.desc}\n点击链接：${jxData.msg.h5}`;
  // console.log(shMsg.value);
  onCopyText(shMsg.value, "文案已复制 - 请前往分享平台粘贴即可！");
};
// 打开链接事件
const onOpen = (url) => {
  window.open(url, "_blank");
};
let jxData = reactive({
  msg: {},
});
const msgData = reactive({
  list: {},
});
// 返回事件判断
const goBackSmart = () => {
  const defaultBackPath = route.meta.defaultBackPath || "/";
  // 尝试返回上一页
  if (window.history.length > 2) {
    router.back();
  } else {
    // 如果历史记录不够（如直接访问详情页），跳转首页
    router.push(defaultBackPath);
  }
};
// 状态码
let isCode = ref(null);
// 内容
let isMsg = ref("");
// loading加载状态
let isLoading = ref(false);
// 获取详情事件
const GetDetails = () => {
  isLoading.value = true;
  axios
    .get(`${API_BASE_URL.value}/link?act_id=${msgData.list.act_id}`)
    .then((res) => {
      isLoading.value = false;
      isCode.value = res.data.code;
      isMsg.value = res.data.msg;
      // console.log(res.data);
      if (res.data.code != 1) {
        showNotify({ type: "warning", message: res.data.msg });
        return;
      }
      jxData.msg = res.data.data;
      GenerateQRCode(window.location.href);
    })
    .catch((err) => {
      isLoading.value = false;
      console.log(err);
    });
};
let path = ref("");
onMounted(() => {
  // 获取quey传参参数中的activity，进行JSON解析和base64解码
  msgData.list = JSON.parse(decode(route.query.activity));
  // console.log(msgData.list.act_id);
  GetDetails();
  path.value = window.location.hostname;

  setTimeout(async () => {
    // 1. 先等待图片转为 Base64
    await ToBase64(msgData.list.img, msgData.list.icon);
    // 预加载资源以优化性能
    await preCache(captureTarget.value);
  }, 1000);
});
// 二维码生成
let QrUrl = ref("");
const GenerateQRCode = (text) => {
  QRCode.toDataURL(text, { errorCorrectionLevel: "H" }, (err, url) => {
    if (err) console.error(err);
    QrUrl.value = url;
  });
};
// 截图
const poserImg = ref(null);
let popShow = ref(false);
const captureElement = async () => {
  // 2. 稍作延迟确保 DOM 更新
  setTimeout(async () => {
    if (captureTarget.value) {
      try {
        const dataUrl = await snapdom.toJpg(captureTarget.value, {
          scale: 2,
          quality: 0.95,
          embedFonts: true,
          compress: true,
        });
        poserImg.value = dataUrl.src;
        popShow.value = true;
        setTimeout(() => {
          const link = document.createElement("a");
          link.href = dataUrl.src;
          link.download = msgData.list.desc + ".jpg"; // 文件名 + 扩展名
          document.body.appendChild(link);
          link.click();
          document.body.removeChild(link); // 清理
        }, 2000);
      } catch (error) {
        console.error("截图失败:", error);
      }
    }
  }, 500);
};
let ToBase64 = async (urlone, urltwo) => {
  const base64Img = await convertImageToBase64(urlone);
  const base64Icon = await convertImageToBase64(urltwo);
  msgData.list.img = base64Img;
  msgData.list.icon = base64Icon;
};
async function convertImageToBase64(imageUrl) {
  try {
    const response = await axios.get(`${API_BASE_URL.value}/proxy/image?url=${encodeURIComponent(imageUrl)}`);
    return response.data.base64;
  } catch (error) {
    console.error("Failed to convert image to Base64:", error);
    return null;
  }
}

// 分享事件
const showShare = ref(false);
const options = [
  [
    {
      name: "复制链接",
      icon: "https://picabstract-preview-ftn.weiyun.com/ftn_pic_abs_v3/47aeec8dc29541cbc62dda1dab5b43ca43a903e0a94cdd532a041ecb1b629955fc8a517220a48709e2db479f11d18cfb?pictype=scale&from=30013&version=3.3.3.3&fname=fsyico.png&size=1080",
      description: "网站首页链接",
    },
    {
      name: "网站海报",
      icon: "https://picabstract-preview-ftn.weiyun.com/ftn_pic_abs_v3/9af3223d19484236bdb75b4f8d21922aaecc790e2b195416a2ed6db6abaaa8ae59d2d7456876fa47a118f4dce3f00f4a?pictype=scale&from=30013&version=3.3.3.3&fname=fsyhb.png&size=1080",
      description: "网站首页海报",
    },
    {
      name: "本页链接",
      icon: "https://picabstract-preview-ftn.weiyun.com/ftn_pic_abs_v3/86d792cbd9a531033e83c1e8805a6704417d0a6b8394e0d0b0dd47f67f4a38fefaf7eb7ff543b2dbddd464a4c66f9d68?pictype=scale&from=30013&version=3.3.3.3&fname=%E5%A4%8D%E5%88%B6%E9%93%BE%E6%8E%A5%20%E9%93%BE%E6%8E%A5%E5%88%86%E4%BA%AB.webp&size=1080",
      description: "本页活动链接",
    },
    {
      name: "本页海报",
      icon: "https://picabstract-preview-ftn.weiyun.com/ftn_pic_abs_v3/b454a013ece13f038a5dbf2286f3a2d68dc65475ef0941af53d22b84bd9dbde82377f7f26caa8812b34988da52b7185e?pictype=scale&from=30013&version=3.3.3.3&fname=%E6%B4%BB%E5%8A%A8%E6%B5%B7%E6%8A%A5.webp&size=1080",
      description: "本页活动海报",
    },
  ],
  [
    { name: "活动链接", icon: "link", description: "该活动直接参与的链接！" },
    { name: "活动海报", icon: "poster", description: "该活动直接参与的海报！" },
  ],
];
// 下载事件
let syPoster = ref(
  `data:image/png;base64,`
);
const downLoagFsy = () => {
  poserImg.value = syPoster.value;
  popShow.value = true;
  setTimeout(() => {
    const link = document.createElement("a");
    link.href = syPoster.value;
    link.download = "tip-ptger.jpg"; // 文件名 + 扩展名
    document.body.appendChild(link);
    link.click();
    document.body.removeChild(link); // 清理
  }, 2000);
};
const onSelect = (option) => {
  switch (option.name) {
    case "复制链接":
      onCopyText(path.value, "网站链接已复制 - 去分享吧！");
      showShare.value = false;
      break;
    case "网站海报":
      downLoagFsy();
      showShare.value = false;
      break;
    case "本页链接":
      onCopyText(window.location.href, "活动链接已复制 - 去分享吧！");
      showShare.value = false;
      break;
    case "本页海报":
      popShow.value = true;
      captureElement();
      showShare.value = false;
      break;
    case "活动链接":
      onCopyText(jxData.msg.h5, "活动链接已复制 - 去分享吧！");
      showShare.value = false;
      break;
    case "活动海报":
      popShow.value = true;
      GenerateQRCode(jxData.msg.long_h5);
      captureElement();
      showShare.value = false;
      break;
  }
};
// 海报下载事件
const downLoadImg = async () => {
  // 直接触发下载
  await poserImg.value.download({
    format: "jpg",
    filename: "chart-report-2024",
  });
};
</script>

