            <div class="shortlink">{{ jxData.msg.tkl }}</div>
            <div class="operate">
              <div class="cp" @click="onCopyText(jxData.msg.tkl, '口令已复制 - 前往对应平台APP打开！')">复制</div>
            </div>
          </div>
          <div class="Kuang">
