          </div>
        </div>
      </div>
      <!-- 海报 -->
      <div class="poster">
        <div class="posterTitle">二维码海报</div>
        <div class="jt" ref="captureTarget">
          <div class="shareCard">
            <div class="shareImg">
              <img class="img" :src="msgData.list.img" alt="" />
              <div class="tipimg">
                <div class="tipico">
                  <img class="img" :src="msgData.list.icon" alt="" />
