            </div>
            <div class="shareTitle">{{ msgData.list.act_name }}</div>
            <div class="describe">活动描述：{{ msgData.list.desc }}</div>
            <div class="describe">截至时间：{{ msgData.list.end_date }}</div>
            <div class="describe">来源平台：翻山羊线报网</div>
            <div class="describe">网址地址：{{ path }}</div>
            <div class="qrKuang">
              <div class="qrlogo">
                <img class="img" :src="FsyLogo" alt="" />
